  const secnum = parseInt(secs, 10);
  const hours = Math.floor(secnum / 3600);
  const minutes = Math.floor(secnum / 60) % 60;
  const seconds = secnum % 60;

  return [hours, minutes, seconds]
    .map((v) => (v < 10 ? "0" + v : v))
    .filter((v, i) => v !== "00" || i > 0)
    .join(":");
